import { render } from '@testing-library/react';
import React, { Component } from 'react';
import { useState } from 'react';
import './App.css';
import { AgGridColumn, AgGridReact } from 'ag-grid-react';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';

class App extends Component {
  render() {

    const [gridApi, setGridApi] = useState(null);
    const [gridColumnApi, setGridColumnApi] = useState(null);

    const [rowData, setRowData] = useState([
        { make: "Toyota", model: "Celica", price: 35000 },
        { make: "Ford", model: "Mondeo", price: 32000 },
        { make: "Porsche", model: "Boxter", price: 72000 }
    ]);

    return (
        <div className="ag-theme-alpine" style={{ height: 400, width: 600 }}>
            <AgGridReact
                rowData={rowData}>
                <AgGridColumn field="make"></AgGridColumn>
                <AgGridColumn field="model"></AgGridColumn>
                <AgGridColumn field="price"></AgGridColumn>
            </AgGridReact>
        </div>
    );

    var mlb_item_order = ['Overall','AL','NL','C','1B','2B','3B','SS','LF','CF','RF','DH'];
    var aaa_item_order = ['Overall','INT','PCL','C','1B','2B','3B','SS','LF','CF','RF','DH'];

    let leagueAverages = require('../src/LeagueAvg.json')

    return (
      <div>
        <p>
        {mapOrder(leagueAverages.filter(leagueAverages => leagueAverages.league == 'MLB'), mlb_item_order, 'split')
          .map((leagueAverages) => (
            <p>{leagueAverages.league} / {leagueAverages.split}</p>
        ))}
        </p>
        <p>
        {mapOrder(leagueAverages.filter(leagueAverages => leagueAverages.league == 'AAA'), aaa_item_order, 'split')
          .map((leagueAverages) => (
            <p>{leagueAverages.league} / {leagueAverages.split}</p>
        ))}
        </p>        
      </div>
    )
  }
}

function mapOrder (array, order, key) {
  array.sort( function (a, b) {
    var A = a[key], B = b[key];

    if (order.indexOf(A) > order.indexOf(B)) {
      return 1;
    } else {
      return -1;
    }

  });

  return array;
};

export default App;
